import React from "react";
import Navbar from "../components/Navbar";
import Footers from "../components/Footers";

export default function Home() {
  return (
    <>
      <div>
        <Navbar />
      </div>
      <div><div c="card" style="width: 18rem;">
  <img src="..." c="card-img-top" alt="..."/>
  <div c="card-body">
    <h5 c="card-title">Card title</h5>
    <p c="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <Link to="#" c="btn btn-primary">Go somewhere</Link>
  </div>
</div></div>
      <div>
        <Footers />
      </div>
    </>
  );
}
